import React from 'react';
import './App.css';
import Button from '@material-ui/core/Button';
import pokemon from './images/pokemon.png'

const Home = () => {

    return(
        <div>
        <img src={pokemon} className='pok' alt="home"/><br/>
        <Button variant='contained' 
        color="secondary"
        size="large"
        style={{
            fontSize: 20,
        }}
        onClick={<Link to="/pokemonlist" />}>
            Goto Pokedex
        </Button>
        </div>
    )
}

export default Home;
